import React from "react";
import { Box, Typography } from "@mui/material";
import { projects } from "../constants/project";
import Project from "./Project";
import Stack from "./Stack";

const Experience = () => {
  return (
    <Box sx={{ maxWidth: "1300px", mx: "auto", my: 12 }} id="experience">
      <Typography
        variant="h3"
        sx={{ color: "white", textAlign: "center", mb: 4 }}
      >
        Let's take a look at what I've{" "}
        <span
          style={{
            color: "rgba(0,199,255,255)",
            fontWeight: "bold",
          }}
        >
          built
        </span>{" "}
        so far
      </Typography>

      <Box
        sx={{
          display: "flex",
          justifyContent: "center", // Center the project cards
          gap: 20,
        }}
      >
        {projects.map((project) => (
          <Project
            key={project.id}
            title={project.title}
            description={project.description}
            tags={project.tags}
            img={project.image}
            sx={{
              width: "300px", // Set a fixed width for each project card
            }}
          />
        ))}
      </Box>

      <Stack />
    </Box>
  );
};

export default Experience;
